control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 10; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 10; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }          
    g5.id = parseInt(g5.dataset1.getData(9, sender.rowIndex));
    g5.name = g5.dataset1.getData(1, sender.rowIndex);
    g5.tmin = g5.dataset1.getData(2, sender.rowIndex);
    g5.tmax = g5.dataset1.getData(3, sender.rowIndex);  
    g5.type = g5.dataset1.getData(4, sender.rowIndex);
    g5.typemin = g5.dataset1.getData(5, sender.rowIndex);
    g5.typemax = g5.dataset1.getData(6, sender.rowIndex);
    g5.operator = g5.dataset1.getData(7, sender.rowIndex);
    g5.regDatetime = g5.dataset1.getData(8, sender.rowIndex);
    g5.range = g5.dataset1.getData(0, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

 g5.table1Click = function(sender) {  
    if (eb.isEmpty(g5.dataset2)) {
        //g5.companyTypeValue = null;
        //g5.companyTypeName = null;
        return;
    }
    g5.status = g5.dataset2.getData(0, sender.rowIndex);
    ee.setText(ee.getControl("panel47"), g5.status); 
    ee.showAni(ee.getControl("panel39"), 1);
} 


query();

control.onClick:
ee.setText(ee.getControl("panel10"), "0");
ee.setCheckBoxValue(ee.getControl("checkbox3"),1) 
ee.setEditText(ee.getControl("edit1"),"")
ee.setEditText(ee.getControl("edit2"),"2")
ee.setEditText(ee.getControl("edit5"),"8")
ee.setCheckBoxValue(ee.getControl("checkbox1"),1)

ee.setEditText(ee.getControl("edit4"),"")
ee.setEditText(ee.getControl("edit7"),"")



g5.operation = "new";
ee.showAni(ee.getControl("panel39"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行编辑");
    return;
} 

ee.setText(ee.getControl("panel10"),g5.id)
if(g5.range=="指定阈值"){ 
    ee.setCheckBoxValue(ee.getControl("checkbox3"),1) 
    ee.setCheckBoxValue(ee.getControl("checkbox4"),0)
} 
else {
    ee.setCheckBoxValue(ee.getControl("checkbox4"),1)
    ee.setCheckBoxValue(ee.getControl("checkbox3"),0)
} 
ee.setEditText(ee.getControl("edit1"),g5.name)
ee.setEditText(ee.getControl("edit2"),g5.tmin)
ee.setEditText(ee.getControl("edit5"),g5.tmax)
if(g5.type=="序列号"){ 
    ee.setCheckBoxValue(ee.getControl("checkbox2"),1)
    ee.setCheckBoxValue(ee.getControl("checkbox1"),0)
}
else { 
    ee.setCheckBoxValue(ee.getControl("checkbox2"),0)
    ee.setCheckBoxValue(ee.getControl("checkbox1"),1)
}
ee.setEditText(ee.getControl("edit4"),g5.typemin)
ee.setEditText(ee.getControl("edit7"),g5.typemax)

g5.operation = "edit";
ee.showAni(ee.getControl("panel39"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");


//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        //"(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([range] like '%" + db.encode(searchText) + "%') or " +
        "([name] like '%" + db.encode(searchText) + "%') or " + 
        "([tmin] like '%" + db.encode(searchText) + "%') or " +
        "([tmax] like '%" + db.encode(searchText) + "%') or " +
        "([type] like '%" + db.encode(searchText) + "%') or " +
        "([typemin] like '%" + db.encode(searchText) + "%') or " + 
        "([typemax] like '%" + db.encode(searchText) + "%') or " +
        "([operator] like '%" + db.encode(searchText) + "%') or " +
        "([regDatetime] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM temperature " +
    "WHERE ([status] <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT * " +
    "FROM temperature " +
    "WHERE (status <> 'DEL') " + condition +
    "ORDER BY id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 


eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"range,name,tmin,tmax,type,typemin,typemax,operator,regDatetime,id", pageSize*(pageCurrent-1), pageSize);

